import Asset from "./Asset";

const Assets = ({
  cash_investments,
  long_term_assets,
  is_editing,
  formatToCurrency,
  toggleEditing,
  currency,
  currency_codes
}) => {
  return (
    <table className="table">
      <tbody>
        <tr>
          <th>Cash and Investments</th>
          <th></th>
          <th></th>
        </tr>
        {cash_investments.map(asset => (
          <Asset
            asset={asset}
            key={asset.id}
            is_editing={is_editing}
            formatToCurrency={formatToCurrency}
            toggleEditing={toggleEditing}
            currency={currency}
            currency_codes={currency_codes}
          />
        ))}
        <tr>
          <th>Long Term Assets</th>
          <th></th>
          <th></th>
        </tr>
        {long_term_assets.map(asset => (
          <Asset
            key={asset.id}
            asset={asset}
            is_editing={is_editing}
            formatToCurrency={formatToCurrency}
            toggleEditing={toggleEditing}
            currency={currency}
            currency_codes={currency_codes}
          />
        ))}
      </tbody>
    </table>
  );
};

export default Assets;
